var tipuesearch = {"pages": [{'title': 'About', 'text': '組員:41023137 林峻源 41023116 吳勁毅 \n 倉儲: https://github.com/mdecd2023/2a-pj1ag21 \n 網站: https://mdecd2023.github.io/2a-pj1ag21/content/index.html \n', 'tags': '', 'url': 'About.html'}, {'title': 'progress', 'text': 'w1:講解課程評分 \n w2:228連假放假 \n w3:製作靜態網站 \n w4:BubbleRub tutorial 製作結果與心得 \n', 'tags': '', 'url': 'progress.html'}, {'title': '心得', 'text': '', 'tags': '', 'url': '心得.html'}, {'title': '41023116吳勁毅心得', 'text': 'W1: 因為寒假期間電腦送修資料遺失 所以再重新用的時候費了很大的時間才用回來 還好組員友會一些不然可能進度將嚴重落後 \n W2: 228放假 \n W3: 因為clone的問題所以進度慢了一個禮拜,今天用成功了,所以我會盡力趕上進度 \n W4: 本周自評,不敢給自己打高分,覺得自己做的內容還不夠充分 \n W5: 建立考試帳號,可是我遲到,所以沒有建立到,下次不會了 \n', 'tags': '', 'url': '41023116吳勁毅心得.html'}, {'title': '41023137', 'text': 'W1: 老師講解課程評分 \n W2: 228連假放假 \n W3: 建立靜態網站，感謝同學的幫忙 \n W4: BubbleRub tutorial製作 \n W5: 建立Exam帳號 \n', 'tags': '', 'url': '41023137.html'}, {'title': 'Note', 'text': 'W3: \n w3 - 2023.03.10.16 已經完成分組網頁者, 可以得到分組網頁評分 \n w3 - 請各組寫一個程式判定 2a 哪一組已經完成網頁建置. \n w3 開始執行 \xa0 https://mde.tw/pjcopsim/content/bubbleRobTutorial.html \n \n 課程內容:創建以及了解如何共同維護團隊的倉儲 \n W4: \n 協同產品設計實習 tutorial1 自評表單 \n \n W5: \n 2a w5 建立考試帳號 \n \n \n \n https://exam.cycu.org \xa0(2023/3/20 08:14-08:20) 第一階段建立帳號 \n 沒有建立帳號者, 請在以下交談登錄學號 \n 本學期, 要求更改一次帳號對應密碼, 酌扣學期成績五分.\xa0 \n \n \n', 'tags': '', 'url': 'Note.html'}, {'title': 'tutorial1', 'text': '\n 1.球體碰撞模擬 \n \n \n \n 檔案: BALL.ttt \n 2.建立馬達,輪子,感測器及程式 \n \n \n \n \n \xa0 \n 檔案: Wheel.ttt \n \xa0 \xa0 \xa0 \xa0 \xa0 Slider.ttt \n \xa0 \xa0 \xa0 \xa0 \xa0 BubbleRob.ttt \n \n \n \n', 'tags': '', 'url': 'tutorial1.html'}, {'title': 'tutorial1 問題', 'text': '\n 1.什麼是 \n \n \n \n \n \n 2. CoppeliaSim中的Scene與Model有何不同? \n   ANS:        Scene : 是一個包含了多個模型和環境元素的虛擬環境，它可以用來模擬現實世界中的場景。         在CoppeliaSim中，您可以使用 Scene來創建、編輯和保存整個場景。         可以向場景中添加不同的東西，例如機器人、物體、傳感器、燈光等，並且可以控制它們的屬性和動作。 \n    Model : 是CoppeliaSim中的一個基本概念，它是場景中的一個單獨的對象。         模型可以是機器人、物體、傳感器等等。         每個模型都有一個唯一的名稱和一個屬性集，可以使用這些屬性來設置模型的位置、旋轉、大小、形狀等等。         每個模型還可以包含一些腳本，用於控制模型的行為。', 'tags': '', 'url': 'tutorial1 問題.html'}, {'title': 'tutorial1 心得', 'text': '\n 41023116吳勁毅: 起初做的時候還滿滿順利,但是做到一些步驟之後卡住了,做到半夜還沒結束,但好在有朋友的幫忙,讓我可以順利做完 \n', 'tags': '', 'url': 'tutorial1 心得.html'}]};